import React from "react";
import { Route, Redirect } from "react-router-dom";

export const PrivateRoute = ({ component: Component, ...rest }) => (
  <Route
    {...rest}
    render={props =>
      localStorage.getItem("lg") ? (
        <Component {...props} />
      ) : (
        <Redirect to={{ pathname: "/", state: props.location }} />
      )
    }
  />
);
